import React from "react";
import Header from "./components/Header";
import './Home.css';
import Name from './components/Name'
import Container from 'react-bootstrap/Container';

function Home(){
      return (
        <div>
            <Header/>
            <Name/>
            <Container>
                <Row>
                    <Col>Research Project</Col>
                    <Col>Hackathon</Col>
                </Row>
            </Container>
        </div>
      );

  }

  export default Home;
